import * as React from 'react';
import { styled } from '../stitches.config';

const GamePlate: React.FC = () => {
	return (
		<Plate>
		</Plate>
	);
};

export default GamePlate;

const Plate = styled('div', {
	minWidth: 100,
	minHeight: 100,
	background: 'rgba(235, 235, 235, 0.36)',
	borderRadius: 16,
	boxShadow: '0 4px 30px rgba(51, 51, 51, 0.36)',
	backdropFilter: 'blur(4px)',
	border: '1px solid rgba(235, 235, 235, 0.36)',
});
